  return (
    <div className="Product">
      <div className="lang-background">
        <Link to="/Lang">
          <div className="btn-back">
            <img src={Back} alt="" />
          </div>
        </Link>
        <div className="product-top-text">Select product</div>
        <div className="bottom-list">
          <ul>
            {list.map((item) => (
              <li key={item.id}>{item.name}</li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Product;
